import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import {Link} from 'react-router-dom'

class HeaderNav extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{fontFamily:"Hammersmith One", width:"100%", color:'black', marginLeft:"1vw", marginTop:"9.8vh", textAlign:"left"}}>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/home/" style={{color:"black"}}><h5 style={{fontSize:"1.8vh"}}>HOME</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/short_films/" style={{color:"black"}}><h5>SHORT FILM</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/concept_designs/1" style={{color:"black"}}><h5>CONCEPT DESIGN</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/illustration/1" style={{color:"black"}}><h5>ILLUSTRATION</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/drafting/1" style={{color:"black"}}><h5>DRAFTING</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/architectures/" style={{color:"black"}}><h5>ARCHITECTURE</h5></Link>
                </Button>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/resume/" style={{color:"black"}}><h5>RESUME</h5></Link>
                </Button>
            </div>
        );
    }
};

export default HeaderNav;
